import React from 'react';
import Link from 'next/link';
import NavStyles from './styles/NavStyles';

const Nav = () => (
  <NavStyles>
     <Link href="/">
        <a>Links</a>
    </Link>
     <Link href="/categr">
        <a>Categorie</a>
    </Link>
  </NavStyles>
);

export default Nav;
